import React, { Component } from "react";

class UserItem extends Component {
  state = {
    login: "shaniaf",
    avatar_url: "https://avatars0.githubusercontent.com/u/12611838?v=4",
    more: "https://api.github.com/users/shaniaf",
  };

  render() {
    return;
    <div className="card text-center">
      <img src={this.stats.avatar_url} />
    </div>;
  }
}
export default UserItem;
